// apiConfig.js

const apiBaseURL = 'https://localhost:7157/api';

const apiEndpoints = {
  login: `${apiBaseURL}/Auth/login`,
  register: `${apiBaseURL}/Auth/register`,
  addProducts: `${apiBaseURL}/Products/`,
  getProducts: `${apiBaseURL}/Products/`,
};

export default apiEndpoints;
